import { Button, Card } from "@mantine/core";
import React from "react";
import Home from "./home1";
import './Page.css';
import { useState } from "react";

cont [rel,setRel] = useState()

function pending()
{
    return(
        <div>
        <a className="corner_button" href='' onClick={()=>{setRel(<Home/>)}}>+ ADD</a>
        </div>
    )
}

function Cart()
{
    return(
        <div>
        <Button className="Cart_Button">Bought</Button>
        <Button className="Cart_Button">Pending</Button>
        <Card className="Cart_card" withBorder>
            {pending()}        
        </Card>
        </div>
    )
}

export default Cart
